import React, { Component } from "react";
import { AirbnbRating } from "react-native-ratings"; //5.3.0
import { Icon } from "react-native-elements";

import {
  Text,
  View,
  StyleSheet,
  Image,
  TouchableOpacity,
  Platform,
} from "react-native";
import Markdown from "react-native-markdown-renderer";
import { Colors, Layout, FontSizes } from "./constants";
import { ScrollView, RectButton } from "react-native-gesture-handler";
import Constants from "expo-constants";
import { View as AnimatableView } from "react-native-animatable";
import { RegularText, BoldText, SemiBoldText } from "./components/StyledText";
const ClipBorderRadius = ({ children, style }) => {
  return (
    <View
      style={[{ borderRadius: 3, overflow: "hidden", marginTop: 10 }, style]}
    >
      {children}
    </View>
  );
};

export default class HomePage extends Component {
  ratingCompleted(rating) {
    console.log("Rating is: " + rating);
  }
  render() {
    return (
      <View>
        <View style={styles.headerContainer}>
          <View style={styles.headerRowSpeaker}>
            <View style={styles.headerColumnSpeaker}>
              <TouchableOpacity onPress={() => console.log("lsjng")}>
                <Image
                  source={{
                    uri:
                      "https://static.toiimg.com/photo/msid-71935935/71935935.jpg",
                  }}
                  style={styles.avatarMultiple}
                />
              </TouchableOpacity>

              <View style={{ alignItems: "center" }}>
                <TouchableOpacity onPress={() => console.log("sdfn")}>
                  <SemiBoldText style={styles.headerText}>
                    Hetan Thakkar
                  </SemiBoldText>
                  <RegularText style={styles.headerText}>
                    @HetanThakkar
                  </RegularText>
                  <BoldText style={styles.talkTitleText}>
                    How i fucked up everything
                  </BoldText>
                </TouchableOpacity>
              </View>
            </View>
          </View>
        </View>
        <AnimatableView
          animation="fadeIn"
          useNativeDriver
          delay={Platform.OS === "ios" ? 50 : 150}
          duration={500}
          style={styles.content}
        >
          <View>
            <View style={{ flexDirection: "row" }}>
              <SemiBoldText style={styles.sectionHeader}>Bio</SemiBoldText>
              <Icon
                name="pages"
                size={25}
                color="#808080"
                style={{ marginLeft: "50%", marginTop: "50%" }}
              />
            </View>
            <Markdown>
              Open source fanatic, technical founder, maker of LiteTimer,
              co-author of react-spring, co-author of immer, co-maintainer of
              react-native-macos, and author of vana.
            </Markdown>
            <View style={{ flex: 1 }}>
              <View style={{ flexDirection: "row" }}>
                <SemiBoldText style={styles.sectionHeader}>
                  Location
                </SemiBoldText>
                <Icon
                  name="location-city"
                  size={25}
                  color="#808080"
                  style={{ marginTop: "40%", marginLeft: "50%" }}
                />
              </View>
              <Markdown>Bhavngar,Gujarat</Markdown>
            </View>
            <View>
              <View style={{ flexDirection: "row" }}>
                <SemiBoldText style={styles.sectionHeader}>Skills</SemiBoldText>
                <Icon
                  name="location-city"
                  size={25}
                  color="#808080"
                  style={{ marginTop: "40%", marginLeft: "50%" }}
                />
              </View>
              <Markdown>Bhavngar,Gujarat</Markdown>
            </View>
          </View>
          <View>
            <View style={{ flexDirection: "row" }}>
              <SemiBoldText style={styles.sectionHeader}>
                Price / Hour :
              </SemiBoldText>
              <Text style={{ fontSize: 20, textAlignVertical: "bottom" }}>
                5
              </Text>
              <Icon
                name="attach-money"
                size={25}
                color="#808080"
                style={{ marginTop: "40%", marginLeft: "50%" }}
              />
            </View>
          </View>

          <View
            style={{
              flexDirection: "row",
              justifyContent: "space-around",
            }}
          >
            <View style={{ flex: 1 }}>
              <View style={{ flexDirection: "row" }}>
                <SemiBoldText style={styles.sectionHeader}>
                  Teaching Medium
                </SemiBoldText>
              </View>
              <Markdown>In-Person</Markdown>
            </View>
            <View style={{ flex: 0.5 }}>
              <View style={{ flexDirection: "row" }}>
                <SemiBoldText style={styles.sectionHeader}>
                  Teaching Location:
                </SemiBoldText>
              </View>
              <Markdown>Student's House / Outside Cafe</Markdown>
            </View>
          </View>
          <View style={{ flexDirection: "row" }}>
            <SemiBoldText style={styles.sectionHeader}>Ratings:</SemiBoldText>
            <AirbnbRating
              count={5}
              selectedColor={Colors.blue}
              reviewColor={Colors.blue}
              reviews={["", "", "", "", "", ""]}
              defaultRating={3}
              starContainerStyle={{ marginLeft: "8%", marginTop: "-9%" }}
              onFinishRating={this.ratingCompleted}
              size={20}
              isDisabled={true}
            />
          </View>
        </AnimatableView>
        <ClipBorderRadius>
          <RectButton
            style={styles.bigButton}
            onPress={this._handlePressJobUrl}
            underlayColor="#fff"
          >
            <SemiBoldText style={styles.bigButtonText}>
              Book This Teacher
            </SemiBoldText>
          </RectButton>
        </ClipBorderRadius>
      </View>
    );
  }
}
const styles = StyleSheet.create({
  container: {},
  bigButton: {
    backgroundColor: Colors.blue,
    paddingHorizontal: 15,
    height: 50,
    marginHorizontal: 15,
    width: "50%",
    alignSelf: "center",
    alignItems: "center",
    justifyContent: "center",
    borderRadius: 3,
    overflow: "hidden",
    flexDirection: "row",
  },
  bigButtonText: {
    fontSize: FontSizes.normalButton,
    color: "#fff",
    textAlign: "center",
  },
  avatar: {
    width: 100,
    height: 100,
    borderRadius: 50,
    marginBottom: 10,
  },
  avatarMultiple: {
    width: 90,
    alignSelf: "center",
    height: 90,
    borderRadius: 500,
    marginTop: 10,
    marginBottom: 10,
  },
  content: {
    backgroundColor: "#fff",
    paddingBottom: 20,
    paddingHorizontal: 20,
  },
  markdownBio: {
    backgroundColor: "#fff",
    paddingBottom: 20,
    paddingHorizontal: 20,
    width: 300,
    height: 200,
  },
  markdownTalkDescription: {
    backgroundColor: "#fff",
    paddingBottom: 20,
    paddingHorizontal: 20,
    width: 300,
    height: 600,
  },
  headerRowSpeaker: {
    flexDirection: "row",
    height: 140,
  },
  headerColumnSpeaker: {
    alignItems: "center",
    justifyContent: "center",
    paddingHorizontal: 5,
  },
  headerContainer: {
    backgroundColor: Colors.blue,
    paddingTop: Constants.statusBarHeight + Layout.notchHeight + 20,
    paddingBottom: 20,
    paddingHorizontal: 20,
    alignItems: "center",
    justifyContent: "center",
  },
  headerText: {
    color: "#fff",
    textAlign: "center",
    fontSize: FontSizes.subtitle,
  },
  talkTitleText: {
    color: "#fff",
    fontSize: FontSizes.title,
    textAlign: "center",
    marginTop: 10,
  },
  sectionHeader: {
    fontSize: FontSizes.bodyTitle,
    marginTop: 15,
    marginBottom: 3,
  },
  videoWrapper: {},
});
